import './App.css'

function App() {
  return (
    <div className="App">
      <div className='main-container'>
        <div className='landing-page'>
          <h1>Title</h1>
          <h3>Sub-title</h3>
          <div className='navigation'>
            <a>Portfolio</a>
            <a>About</a>
            <a>Request to Book</a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
